Cinco De Mayo, outside of being a celebration of Mexican pride, is a great excuse to get wasted and do shit you otherwise wouldnt do. Its a great scapegoat for all the nasty things you do on the holiday.  I have reason to believe that these crazy college kids felt the same way when they recorded themselves in full blown orgy mode. To celebrate Cinco De Mayo, the boys and girls involved got themselves decked out in traditional Mexican regalia colorful sombreros and ponchos, maracas in one hand, big ass margaritas in the other and got the party started in style. Once the festivities were underway, a freaky as all hell fuckfest went down quicker than you can say I dare you to fuck this pinata. This actually happens, I kid you not.
